const ViaCep = () =>{
    const {register, handleSubmit} = useForm

    const onSubmit = (e) =>{
        console.log(e)
    }
    return(
        <form onSubmit={handleSubmit(onSubmit)}>
            <label>
                CEP:
                <input type='text' {...register('cep')} />
            </label>
        </form>
    )
}

export default ViaCep
